卵と水を入れて電子レンジで加熱するだけで、ゆでたまごが簡単に作れます。<br>卵の仕上がり加減も自由自在なので、固ゆで、半熟が思いのまま。<br>一度に2個のゆでたまごが作れます。<br><br>■固ゆで、半熟、思いのまま<br>卵と水を入れて電子レンジで加熱するだけで、<br>ゆでたまごが簡単に作れます。<br>卵の仕上がり加減も自由自在なので、固ゆで、半熟が<br>思いのまま。一度に2個のゆでたまごが作れます。<br><br>■レンジでもう一品のおかず作りにチャレンジ！<br>「レンジでらくチン！ゆでたまご（2個用）」で<br>ゆで卵つくりにチャレンジ！お鍋を用意することなく、<br>短時間でゆで卵が作れます！<br><ul><li>2個用<br></li><li>寸法：約全幅16.8×奥行10.1×全高10.5（cm）<br></li><li>重量：約140g<br></li><li>耐熱温度：120℃<br></li><li>耐冷温度：-20℃<br></li><li>材質<br>樹脂部：ポリプロピレン<br>受皿、蓋：内側 アルミニウム（アルマイト加工）<br></li></ul><br><br>曙産業 AKEBONO レンジでらくチン ゆでたまご【2個用】 RE-277<br><img border="0" src="http://image.rakuten.co.jp/akibaoo-r/cabinet/gi49/4954267102778-3.jpg"><table width="800" border="0" cellspacing="0" cellpadding="0">

